syntax="proto3";

package aws;

message AwsRdsClusterEndpoint {
  string arn = 1;
  string cluster_endpoint_identifier = 2;
  string cluster_identifier = 3;
  string custom_endpoint_type = 4;
  string endpoint = 5;
  repeated string excluded_members = 6;
  string id = 7;
  repeated string static_members = 8;
  map<string, string> tags = 9;
}